import React from "react";


const  Header = (props) => {

    return (
        
        <div className="container">
            <img src="https://www.cumhuriyet.com.tr/Archive/2023/1/31/131047965-barismanco4.jpg" alt="" srcset="" />
            <h2>{props.fullName}</h2>
            <h3>{props.person.title}</h3>
            <h4 className='web'><a href="#">{props.person.webSite}</a></h4>
        </div>
    )
}
export default Header;
